import './Changeappointment.css';

 class Changeappointment extends Component {
    render() {
        return (
            <div className="change-appoint">
               <div className="buttons">
                    <button>CHANGE APPOINTMENTS DETAILS</button>
                    <button>ADD OTHERS DETAILS</button>
                    <p>react-page-layout allows you to share a common layout across many different componentsa and  reducing code duplication.</p>
                    <div className="booking-part">
                       <div className="booking">
                         <h>Booking ID</h>
                         <p>NYKHUL8118</p>
                         <h>Seller Name</h>
                         <p>HUL</p>
                       </div>
                        <div className="location">
                            <h>sjkjdh</h>
                            <p>assadhsh</p>
                        </div>
                   </div>
              </div>

            </div>

        )
    }
}
export default Changeappointment;
